import * as React from 'react';
import { Container, Box, Divider, VStack } from 'native-base';
import { Dimensions, Platform } from 'react-native';
import { AppHeader } from '../../components/AppHeader';

interface IProps {
    navigation?: any
}

const Home: React.FC<IProps> = (props) => {
    const { width } = Dimensions.get('window');

    return <Container bg={'blue.50'} w={width}>
        <AppHeader navigation={props.navigation} isDrawer={Platform.OS === 'web' ? true : false} />
        <Box borderX="1" borderRadius="md" bg={'blue.700'}>
            <VStack space="4" divider={<Divider />} m="5">
                <Box px="4" pt="4">
                    NativeBase
                </Box>
                <Box px="4">
                    NativeBase is a free and open source framework that enable developers
                    to build high-quality mobile apps using React Native iOS and Android
                    apps with a fusion of ES6.
                </Box>
                <Box px="4" pb="4">
                    GeekyAnts
                </Box>
            </VStack>
        </Box>
    </Container>
}

export default Home;
